ision:"Thuộc tính không hợp lệ. Vui lòng kiểm tra lại.",ps_attr_tooltip_product_name:"Tên sản phẩm nên bao gồm tên thương hiệu và dòng sản phẩm. Việc sử dụng các từ khóa không liên quan có thể khiến sản phẩm bị xóa.",ps_attr_tooltip_product_attributes:"Thuộc tính sản phẩm là những đặc điểm riêng biệt làm nổi bật cho sản phẩm của bạn. Thông tin thuộc tính chính xác giúp Người mua tìm kiếm sản phẩm của bạn dễ dàng hơn.",ps_attr_tooltip_product_attributes_invalid:"Vui lòng cập nhật thuộc tính để giúp Người mua tìm kiếm sản phẩm dễ dàng hơn. Bạn cũng có cập nhật thuộc tính sản phẩm trong trang Kênh Người bán > Sản phẩm > Nhập hàng hoạt",ps_attr_tooltip_product_price:"Vui lòng đăng sản phẩm với mức giá bạn sẵn lòng bán. Việc thiết lập mức giá quá thấp không nhằm mục đích bán sản phẩm có thể khiến cho sản phẩm của bạn bị xóa.",ps_attr_invalid_attribute:"Thuộc tính không hợp lệ",ps_wrong_category:"Cải thiện Danh mục",ps_wrong_category_revise_tooltip:"Danh mục sản phẩm không đúng, vui lòng chỉnh lại.",ps_wrong_category_warning_message:"Danh mục sản phẩm không đúng, vui lòng kiểm tra lại nhằm tăng hiệu quả tìm kiếm.",ps_label_example:"Xem ví dụ ở đây",ps_all_categories:"TẤT CẢ NGÀNH HÀNG",ps_recommend_categories:"NGÀNH HÀNG ĐỀ XUẤT",ps_promo_stock:"Kho hàng",ps_promo_stock_wms_stock_sync:"Tồn kho sẽ được cập nhật tự động theo Hệ thống quản lý kho. Hoặc bạn có thể thay đổi {{route}} để cập nhật thủ công.",ps_promo_low_stock:"Sắp hết hàng, vui lòng nhập thêm",ps_label_min_campaign_stock:"Kho hàng tối thiểu tham gia chương trình",ps_error_total_stock_too_small:"Tổng kho hàng của 1 sản phẩm phải từ {{{min}}} trờ lên",ps_label_campaign_stock:"Kho hàng chương trình",ps_change_phone_number:"Thay đổi số điện thoại",ps_enter_code_to_old_number:"Vui lòng nhập mã xác nhận đã được gửi tới số điện thoại cũ của bạn.",ps_enter_new_phone:"Vui lòng nhập số điện thoại mới của bạn.",ps_enter_code_to_new_number:"Vui lòng nhập mã xác nhận đã được gửi tới số điện thoại mới của bạn.",ps_free_shipp